import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import NavBar from "./components/NavBar";
import BrowseClassesPage from "./pages/BrowseClassesPage";
import ClassRecordsPage from "./pages/ClassRecordsPage";
import AdminDashboard from "./pages/AdminDashboard";
import AdminClassList from "./pages/AdminClassList";
import ClassList from "./pages/ClassList";

function App() {
  return (
    <Router>
      <NavBar /> {/* Appears on all pages */}
      <Routes>
        <Route path="/" element={<BrowseClassesPage />} />
        <Route path="/classes" element={<ClassList />} />
        <Route path="/admin" element={<AdminDashboard />} />
        <Route path="/admin/classes" element={<AdminClassList />} />
        <Route path="/admin/records" element={<ClassRecordsPage />} />
      </Routes>
    </Router>
  );
}

export default App;
